// Export individual categories for convenience
export const PlanetIcons = IconData.planets;
export const SignIcons = IconData.signs;
export const AspectIcons = IconData.aspects;

// Helper function to check if an icon exists
export function hasIcon(category, name) {
    return IconData[category] && IconData[category][name] !== undefined;
}

// Helper function to get an icon data URL
export function getIconDataUrl(category, name) {
    if (hasIcon(category, name)) {
        return IconData[category][name];
    }
    return null;
}
